(57, 1, '2023-01-17 21:57:57', '2023-01-17 20:57:57', '[email* email-newsletter placeholder \"Enter your email\"]<button type=\"submit\" class=\"button\">Submit</button>\n1\n[_site_title] - \"[your-subject]\"\n[_site_title] <danielczajkowski0@gmail.com>\n[_site_admin_email]\nNadawca: [your-name] <[your-email]>\r\nTemat: [your-subject]\r\n\r\nTreść wiadomości:\r\n[your-message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] - \"[your-subject]\"\n[_site_title] <danielczajkowski0@gmail.com>\n[your-email]\nTreść wiadomości:\r\n[your-message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [_site_admin_email]\n\n\n\nTwoja wiadomość została wysłana. Dziękujemy!\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nPrzynajmniej jedno pole zawiera błąd. Proszę sprawdzić wpisaną treść i spróbować ponownie.\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nMusisz wyrazić zgodę na powyższe zapisy, aby móc wysłać formularz.\nProszę wypełnić to pole.\nW polu wprowadzono zbyt dużo znaków.\nW polu wprowadzono zbyt mało znaków.\nPodczas wgrywania pliku wystąpił nieznany błąd.\nNie możesz wgrywać plików tego typu.\nPrzesłany plik jest za duży.\nWystąpił błąd podczas wgrywania pliku.\nWprowadź datę w formacie RRRR-MM-DD.\nData wybrana w tym polu jest zbyt wczesna.\nData wybrana w tym polu jest zbyt późna.\nWprowadź liczbę.\nZa mała liczba.\nZa duża liczba.\nOdpowiedź w quizie jest nieprawidłowa.\nProszę wpisać adres e-mail.\nProszę wprowadzić adres URL.\nProszę podać numer telefonu.', 'Newsletter', '', 'publish', 'closed', 'closed', '', 'formularz-1', '', '', '2023-01-18 01:40:48', '2023-01-18 00:40:48', '', 0, 'http://localhost/cut2code/?post_type=wpcf7_contact_form&#038;p=57', 0, 'wpcf7_contact_form', '', 0),
